import axios from "axios";

const country = "Japan"

const fetchLocationData = async () => {
    try {
        const {data} = await axios.get("https://skyscanner-skyscanner-flight-search-v1.p.rapidapi.com/apiservices/autosuggest/v1.0/UK/GBP/en-GB/", {
            headers: {
                "content-type": "application/json",
                "x-rapidapi-host": "skyscanner-skyscanner-flight-search-v1.p.rapidapi.com",
                "x-rapidapi-key": "f3b72532e5mshf3212aa087d7ef8p170d42jsnb3b9bd882b75",
                useQueryString: true,
                    },
            params: {
                query: `${country}`,
            },
        })

        console.log(data);
        data.map((location) => {
            location.CountryName
        })

    } catch (err) {
        console.error(err);
    }
}

fetchLocationData();
